    value: Any transfers to the Non-federal account reported on Schedule B supporting
      line 22 were not in any way used in connection with any federal election, or
      any federal candidate, or any activities that qualify as Federal Election Activity.  Rather,
      these transferred funds were utilized solely in connection with state and non-federal
      candidates and activities.    The committee does not use any national party
      transfers to fund Federal Election Activity.  The party utilizes a strict accounting
      method to ensure that national party transfers are being used only for permissible
      administrative and overhead expenses.  This accounting method also guarantees
      that all Federal Election Activity is being funded by contributions raised under
      the limitations and prohibitions of the Federal Election Campaign Act, as amended.    The
      phrase Voter registration table in the purpose field on H6 is generic in nature
      and does not reference any federal candidate or any other Federal Election Activity.  The
      individuals who maintain these tables are not employees of the committee and
      therefore not subject to 11 CFR 300.33(d)(2).    A $5,000 individual contribution
      dated 10/19/09 was incorrectly deposited into the Federal account, when it should
      have been deposited into the Non-federal account.  On 12-3-09, a transfer of
      $5,000 was made from the Federal account to the Non-federal account.  A copy
      of this transfer check and a letter of explanation were mailed to the Commission.  This
      transfer of $5,000 is reflected in this report.
